import { Link } from "react-router-dom";

function Home () {
    return (
        <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/Game">Game</Link>
          </li>
        </ul>
      </nav>
    );
}
export default Home;
